import Menu from "../Menu";
import UploadButton from "../UploadButton";
import { faQuestionCircle, faA, faKeyboard, faMessage, faPaperPlane } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import styles from './HeaderLogged.module.scss'
const MENUS = [
    {
      title: "English",
      iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faA} />,
      children: [
        { title: "English", code: 'en' },
        { title: "Việt Nam", code: 'vi' },
        { title: "日本", code: 'ja' },
      ],
    },
    { title: "Feedback and help", iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faQuestionCircle} /> },
    { title: "Keyboard shortcuts", iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faKeyboard} /> },
  ]
function HeaderLogged() {
    return ( 
        <>
          <UploadButton to="/upload" stylesupload='wrapper'>Upload</UploadButton>
          <div className={styles['messages-icon']}>
            <FontAwesomeIcon className={styles["icon"]} icon={faPaperPlane} />
          </div>
          <div className={styles['inbox-icon']}>
            <FontAwesomeIcon className={styles["icon"]} icon={faMessage} />
          </div>
          <Menu menus={MENUS}>
            <div className={styles['user-avatar']}></div>
          </Menu>
        </>
     );
}

export default HeaderLogged;
